#include <bits/stdc++.h>using namespace std; void solve(){    // LOGIC    string s;    cin >> s;    unordered_map<char, int> m;     for(auto i : s){        m[i]++;    }    int c = 0;    for(auto i:m){        c += i.second%2;    }         if((c &1) ||c == 0) cout << "First\n";    else cout << "Second\n";  } int main(){    ios::sync_with_stdio(false); // Fast I/O    cin.tie(nullptr);            // Untie cin from cout    solve();}